MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "The Calibre RealTime Digital interface integrates flat Calibre nmDRC with supported place and route design tools so that a Calibre nmDRC run can be started directly from the design tool. Calibre RealTime Digital loads the complete Calibre rule file, but  check recipes  give you control over what checks are executed for each Calibre run. Calibre nmDRC is run on a selected region of the design. ");
MGCAddSnippet(6, "Certain requirements for the design tool, environment variables, and Calibre rule file must be met before running Calibre RealTime Digital.");
MGCAddSnippet(7, "The Calibre RealTime Digital platform integrates flat Calibre nmDRC with supported design tools so that Calibre nmDRC can be run directly from the design tool. Calibre and Calibre RealTime Digital differ in run mode support, layout processing, SVRF command support, and result output. ");
MGCAddSnippet(8, "Certain terms and concepts, such as check selection recipe, halo, run configuration, and run context, are used when discussing Calibre RealTime Digital operation.");
MGCAddSnippet(9, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(10, "All integrations of Calibre RealTime Digital share some basic methodology, such as halo usage and configuration file usage. Some integrations support API control for setting options and controlling environment variables. ");
MGCAddSnippet(11, "Halos ensure that new errors caused by changes in the geometry are reported, and false errors caused by edge effects are not reported. Halos are used for all Calibre RealTime Digital runs. Each time Calibre RealTime Digital runs Calibre nmDRC, a halo expands the area around the region selected for the run so that surrounding geometries are included. ");
MGCAddSnippet(12, "As with other rule checks, Density checks in Calibre RealTime Digital analyze the visible region in the layout window plus a halo region or the current cell, depending on whether Run DRC in Window or Run DRC in Cell is clicked. Although the Density results are accurate for the specific run context, the results may differ from those of a Calibre batch run or a Calibre RealTime Digital run with a different run context. ");
MGCAddSnippet(13, "Density checks may give spurious results in Calibre RealTime Digital if they are run on a small region of the design.");
MGCAddSnippet(14, "Calibre RealTime Digital run configurations, option settings, and check recipe definitions are saved in the Calibre RealTime Digital session configuration file. The configuration file is saved automatically and named .realtime.cfg. The configuration file is saved in your home directory by default; however, you may specify a different location for the configuration file. ");
MGCAddSnippet(15, "The Calibre RealTime Digital session configuration file is saved in your home directory by default. It can also be saved in a user-defined directory. The configuration file is named .realtime.cfg. ");
MGCAddSnippet(16, "Calibre RealTime Digital supports reading the session configuration file from a specified directory or multiple directories. If configuration files are located in multiple directories, the order of precedence is set with the environment variable MGC_REALTIME_CONFIG_DIRS. This feature allows system and project administrators to define settings for a group or project while still allowing settings to be adjusted by individual users. ");
MGCAddSnippet(17, "The MGC_REALTIME_CONFIG_DIRS environment variable specifies a list of one or more directories separated by a colon (:), where each directory contains a .realtime.cfg file. The order of precedence is from left to right, as with the Unix $PATH variable. MGC_REALTIME_CONFIG_DIRS also specifies the location of the writable session configuration file for saving updated configuration settings. ");
MGCAddSnippet(18, "You can create and define multilevel configuration files for Calibre RealTime Digital. This allows Calibre RealTime Digital to read settings from more than one configuration file. ");
MGCAddSnippet(19, "The Calibre RealTime Digital license is checked out when you start a Calibre RealTime Digital run. You can set the timeout period for the Calibre RealTime Digital license. The license timeout period also applies to the Calibre RealTime Results window. ");
MGCAddSnippet(20, "You can view results from a Calibre RealTime Digital run in the Calibre RealTime Digital Results window, which is similar to Calibre RVE for DRC. The window includes a tree and details view, a check text pane, and controls for highlighting. Some standard keyboard hotkeys (shortcuts) for highlighting and result navigation are defined. ");
MGCAddSnippet(21, "Calibre RealTime Digital provides commands to control options and environment variables from the command interface of supported design tools. You can also set environment variables to specify the path to certain input files. ");
MGCAddSnippet(22, "You can set environment variables to specify the path to certain input files for Calibre RealTime Digital. The environment variables apply to all supported design tools.");
MGCAddSnippet(23, "Calibre RealTime Digital uses a number of environment variables to specify run-time behavior. ");
MGCAddSnippet(24, "If you use Calibre Interactive nmDRC and want to use the same options for your Calibre RealTime Digital run, you can specify the Calibre Interactive runset in the Calibre RealTime Options dialog box. Calibre RealTime Digital calls Calibre Interactive to generate the Calibre Interactive control file, and the control file is used for the Calibre RealTime Digital run. If the runset includes a customization file, the Customization GUI is opened and the settings are applied to the control file.");
MGCAddSnippet(25, "You can specify a Calibre Interactive runset instead of a rule file for a Calibre RealTime Digital run. Calibre RealTime Digital calls Calibre Interactive to generate the Calibre Interactive control file. The generated control file is used for the Calibre RealTime Digital run, so that all the options set in the runset are used for the Calibre RealTime Digital run. You can use the Calibre RealTime Options dialog box or an environment variable to specify Calibre Interactive runsets. ");
MGCAddSnippet(26, "If you use a customization file with Calibre Interactive nmDRC, you can use the same customization file with Calibre RealTime Digital. This allows you to make customization settings at any time and apply them to your Calibre RealTime Digital session. ");
MGCAddSnippet(27, "DRC Rule Check Comments are one way to specify the highlight color or highlight layer for Calibre RealTime Digital results. Rule check comments are supported for all tools with Calibre RealTime Digital. The rule check comments specify the highlight color or highlight layer index for a given rule check so that results from a given rule check are always highlighted in the same color.");
MGCAddSnippet(28, "You can specify DRC Rule Check comments for Calibre RealTime in a Check Text Override file (CTO file). The CTO file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(29, "A DRC RVE rule check comment that specifies the highlight layer index used for the rule check. ");
MGCAddSnippet(30, "A DRC RVE rule check comment that specifies the highlight layer color used for the rule check in supported layout viewers. ");
MGCAddSnippet(31, "A DRC RVE rule check comment that specifies the layers that are shown in the layout editor when highlighting a result from the rule check. ");
MGCAddSnippet(32, "A DRC RVE rule check comment that creates a hyperlink that is displayed in the check text pane of Calibre RealTime Results window for the rule check. ");
MGCAddSnippet(33, "The check text override file (CTO file) allows you to specify DRC RVE rule check comments for a Calibre RealTime run without editing the rule file. DRC RVE rule check comments can specify the highlight color or the highlight layer index for errors found during a Calibre RealTime run.");
MGCAddSnippet(34, "Calibre RealTime Digital uses a check selection recipe to define the rule checks that are executed during the run. A number of built-in check recipes are provided, and you can define your own check recipes.");
MGCAddSnippet(35, "A check recipe is a set of rules for selecting the checks to execute for a Calibre RealTime Digital run. Calibre RealTime Digital defines a set of built-in check recipes, and you can create custom check recipes. ");
MGCAddSnippet(36, "The check recipe selects which rule checks are executed during the Calibre RealTime Digital run.");
MGCAddSnippet(37, "Calibre RealTime Digital includes several built-in check selection recipes. These built-in check recipes include commonly used check selections, such as  Checks selected in the rules file ,  All checks , and  Visible layer checks.  ");
MGCAddSnippet(38, "You can use the environment variable MGC_CALIBRE_HIDDEN_RECIPES to hide specified built-in check recipes. Hidden check recipes do not appear in the dropdown list of check recipes in the toolbar, in the Calibre RealTime Options dialog box, or in the Calibre RealTime recipe editor. ");
MGCAddSnippet(39, "Custom check recipes (also called user recipes) enable you to control the Calibre rule checks that are executed during a Calibre nmDRC run. You can create a new custom check recipe or start by copying an existing recipe.");
MGCAddSnippet(40, "The basic editing controls in the Calibre RealTime Recipe Editor dialog box allow you to construct check recipes based on a short list of common expressions, such as  Checks selected in the rule file  and  Checks with density . You can also include and exclude individual checks and check groups. ");
MGCAddSnippet(41, "The advanced editing controls in the Calibre RealTime Recipe Editor allow you to select checks by layer, select checks that did or did not produce results, and select and unselect individual rule checks. Unselecting individual checks is useful if a particular check gives false errors when run on a limited area.");
MGCAddSnippet(42, "The Recipe editor dialog box includes controls to create, copy, save, and edit a check selection recipe for Calibre RealTime Digital. ");
MGCAddSnippet(43, "The Calibre RealTime Digital interface is integrated with the CadenceInnovus design tool, enabling you to start a Calibre nmDRC run directly from the open design as you edit.");
MGCAddSnippet(44, "Requirements for tool versions, input files, and environment variables must be met in order to run Calibre RealTime Digital in Cadence Innovus. ");
MGCAddSnippet(45, "Certain requirements for design tool versions, layer map files, and environment variables must be met to run Calibre RealTime Digital in Cadence Innovus. ");
MGCAddSnippet(46, "The Calibre integration to Cadence Innovus requires a Tcl script to be loaded. ");
MGCAddSnippet(47, "An environment variable must be set to enable Calibre RealTime Digital operation with Cadence Innovus. ");
MGCAddSnippet(48, "The support of Calibre RealTime Digital in Cadence Innovus depends on the Calibre release and the Cadence version. ");
MGCAddSnippet(49, "A layer map file is required to map the Cadence Innovus layer objects to GDS layers and datatypes for layout export. The layer map file can be read automatically from the working directory, specified with an environment variable, or specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(50, "When setting up IP Merge, you select which layout files to incorporate into your DRC runs. You can use both individual layout files or file lists, which are text files where each line is a path to a file or a directory. You can select multiple file lists to use, as well as select a combination of individual files and file lists.");
MGCAddSnippet(51, "Several tasks are required to start and run Calibre RealTime Digital in Cadence Innovus.");
MGCAddSnippet(52, "After invoking Cadence Innovus with Calibre RealTime Digital, you see the Calibre RealTime Digital integrated toolbar.");
MGCAddSnippet(53, "A run configuration in Calibre RealTime Digital is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(54, "Calibre RealTime Digital uses a standard Calibre nmDRC rule file. The check recipe controls which checks in the rule file are executed during the Calibre RealTime Digital run.");
MGCAddSnippet(55, "Calibre RealTime Digital runs checks on the geometries available in the Cadence Innovus window plus a halo around the region in window mode. Checks are run on the whole cell in cell mode. The specified check recipe selects the checks that are executed. All Calibre RealTime Digital DRC runs are performed in flat mode.");
MGCAddSnippet(56, "You can specify the highlight color used by Calibre RealTime Digital with the CalibreSetupRVE menu selection in Cadence Innovus. You can also specify DRC Rule Check Comments in a Check Text Override (CTO) file or the rule file. ");
MGCAddSnippet(57, "You can use a Check Text Override (CTO) file to assign the layer visibility for results according to the rule check. The Check Text Override file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(58, "You can start a batch Calibre run from Calibre RealTime Digital if the design window contains more than a specified number of polygons. The controls for starting a batch run are on the Batch tab in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(59, "IP Merge is configured in the Calibre RealTime Digital Options dialog box. After IP Merge is set up, DRC runs use the provided layout files to better identify rule violations.");
MGCAddSnippet(60, "The Calibre RealTime Digital integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime Digital. ");
MGCAddSnippet(61, "The Calibre RealTime Digital integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(62, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Digital configuration file. ");
MGCAddSnippet(63, "The Batch tab has settings for controlling a Calibre batch run started from Calibre RealTime Digital. You can set the number of polygons in the layout window that trigger a batch run, and execution and licensing options. ");
MGCAddSnippet(64, "The IP Merge tab has settings that allow customization of IP Merge when running DRC in Calibre RealTime Digital. You can control which layout files to use and how violations are highlighted.");
MGCAddSnippet(65, "A set of standard keyboard shortcuts are provided for Calibre RealTime Digital in Cadence Innovus.");
MGCAddSnippet(66, "You can define custom keyboard shortcuts for Calibre RealTime Digital. The Calibre installation provides a file of standard keyboard shortcuts. ");
MGCAddSnippet(67, "The Calibre RealTime Digital interface is integrated with the IC Compiler II design tool from Synopsys. Calibre RealTime Digital integrates flat Calibre nmDRC with supported place and route tools so that Calibre nmDRC can be run directly from the design tools.");
MGCAddSnippet(68, "Requirements for tool versions, input files, and environment variables must be met in order to run Calibre RealTime Digital in IC Compiler II. ");
MGCAddSnippet(69, "Certain requirements for design tool versions, layer map files, and environment variables must be met to run Calibre RealTime Digital in IC Compiler. ");
MGCAddSnippet(70, "The Calibre integration to the IC Compiler II tool requires a Tcl script to be loaded. ");
MGCAddSnippet(71, "The support of Calibre RealTime Digital in IC Compiler II depends on the Calibre release and the IC Compiler II version. ");
MGCAddSnippet(72, "A layer map file is required to map the IC Compiler II layer objects to GDS layers and datatypes for layout export. The layer map file can be specified with an environment variable or specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(73, "When setting up IP Merge, you select which layout files to incorporate into your DRC runs. You can use both individual layout files or file lists, which are text files where each line is a path to a file or a directory. You can select multiple file lists to use, as well as select a combination of individual files and file lists.");
MGCAddSnippet(74, "Several tasks are required to start and run Calibre RealTime Digital in IC Compiler II.");
MGCAddSnippet(75, "After invoking IC Compiler II with Calibre RealTime Digital, you see the Calibre RealTime Digital integrated toolbar.");
MGCAddSnippet(76, "A run configuration in Calibre RealTime Digital is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(77, "Calibre RealTime Digital uses a standard Calibre nmDRC rule file. The check recipe controls which checks in the rule file are executed during the Calibre RealTime Digital run.");
MGCAddSnippet(78, "Calibre RealTime Digital runs checks on the geometries visible in the IC Compiler II window plus a halo around the region. The specified check recipe selects the checks that are executed. All Calibre RealTime Digital DRC runs are performed in flat mode.");
MGCAddSnippet(79, "You can specify the highlight color used by Calibre RealTime Digital with the CalibreHighlight Colors menu selection in IC Compiler II. You can also specify DRC Rule Check Comments in a Check Text Override (CTO) file or in the rule file. ");
MGCAddSnippet(80, "You can use a Check Text Override (CTO) file to assign the layer visibility for results according to the rule check. The Check Text Override file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(81, "You can start a batch Calibre run from Calibre RealTime Digital if the design window contains more than a specified number of polygons. The controls for starting a batch run are on the Batch tab in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(82, "IP Merge is configured in the Calibre RealTime Digital Options dialog box. After IP Merge is set up, DRC runs use the provided layout files to better identify rule violations.");
MGCAddSnippet(83, "The Calibre RealTime Digital integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime Digital. ");
MGCAddSnippet(84, "The Calibre RealTime Digital integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(85, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Digital configuration file. ");
MGCAddSnippet(86, "The Batch tab has settings for controlling a Calibre batch run started from Calibre RealTime Digital. You can set the number of polygons in the layout window that trigger a batch run, and execution and licensing options. ");
MGCAddSnippet(87, "The IP Merge tab has settings that allow customization of IP Merge when running DRC in Calibre RealTime Digital. You can control which layout files to use and how violations are highlighted.");
MGCAddSnippet(88, "A set of standard keyboard shortcuts are provided for Calibre RealTime Digital in IC Compiler II.");
MGCAddSnippet(89, "You can define custom keyboard shortcuts for Calibre RealTime. The Calibre installation provides a file of standard keyboard shortcuts. ");
MGCAddSnippet(90, "The Calibre RealTime Digital interface is integrated with the Fusion Compiler design tool from Synopsys. Calibre RealTime Digital integrates flat Calibre nmDRC with supported place and route tools so that Calibre nmDRC can be run directly from the design tools.");
MGCAddSnippet(91, "Requirements for tool versions, input files, and environment variables must be met in order to run Calibre RealTime Digital in Fusion Compiler. ");
MGCAddSnippet(92, "Certain requirements for design tool versions, layer map files, and environment variables must be met to run Calibre RealTime Digital in Fusion Compiler. ");
MGCAddSnippet(93, "The Calibre integration to the Fusion Compiler tool requires a Tcl script to be loaded. ");
MGCAddSnippet(94, "The support of Calibre RealTime Digital in Fusion Compiler depends on the Calibre release and the Fusion Compiler version. ");
MGCAddSnippet(95, "A layer map file is required to map the Fusion Compiler layer objects to GDS layers and datatypes for layout export. The layer map file can be specified with an environment variable or specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(96, "When setting up IP Merge, you select which layout files to incorporate into your DRC runs. You can use both individual layout files or file lists, which are text files where each line is a path to a file or a directory. You can select multiple file lists to use, as well as select a combination of individual files and file lists.");
MGCAddSnippet(97, "Several tasks are required to start and run Calibre RealTime Digital in Fusion Compiler.");
MGCAddSnippet(98, "After invoking Fusion Compiler with Calibre RealTime Digital, you see the Calibre RealTime Digital integrated toolbar.");
MGCAddSnippet(99, "A run configuration in Calibre RealTime Digital is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(100, "Calibre RealTime Digital uses a standard Calibre nmDRC rule file. The check recipe controls which checks in the rule file are executed during the Calibre RealTime Digital run.");
MGCAddSnippet(101, "Calibre RealTime Digital runs checks on the geometries visible in the Fusion Compiler window plus a halo around the region. The specified check recipe selects the checks that are executed. All Calibre RealTime Digital DRC runs are performed in flat mode.");
MGCAddSnippet(102, "You can specify the highlight color used by Calibre RealTime Digital with the CalibreHighlight Colors menu selection in Fusion Compiler. You can also specify DRC Rule Check Comments in a Check Text Override (CTO) file or in the rule file. ");
MGCAddSnippet(103, "You can use a Check Text Override (CTO) file to assign the layer visibility for results according to the rule check. The Check Text Override file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(104, "You can start a batch Calibre run from Calibre RealTime Digital if the design window contains more than a specified number of polygons. The controls for starting a batch run are on the Batch tab in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(105, "IP Merge is configured in the Calibre RealTime Digital Options dialog box. After IP Merge is set up, DRC runs use the provided layout files to better identify rule violations.");
MGCAddSnippet(106, "The Calibre RealTime Digital integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime Digital. ");
MGCAddSnippet(107, "The Calibre RealTime Digital integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(108, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Digital configuration file. ");
MGCAddSnippet(109, "The Batch tab has settings for controlling a Calibre batch run started from Calibre RealTime Digital. You can set the number of polygons in the layout window that trigger a batch run, and execution and licensing options. ");
MGCAddSnippet(110, "The IP Merge tab has settings that allow customization of IP Merge when running DRC in Calibre RealTime Digital. You can control which layout files to use and how violations are highlighted.");
MGCAddSnippet(111, "A set of standard keyboard shortcuts are provided for Calibre RealTime Digital in Fusion Compiler.");
MGCAddSnippet(112, "You can define custom keyboard shortcuts for Calibre RealTime. The Calibre installation provides a file of standard keyboard shortcuts. ");
MGCAddSnippet(113, "Use the Calibre RealTime Digital API commands to get and set Calibre RealTime Digital environment variables and options within the design environment. The Calibre RealTime Digital API also offers script-level access to Calibre RealTime operations.  The commands that control environment variables and options can be used in all design environments. The commands that run DRC, highlight results, and run configuration managements are only supported in Cadence Innovus and Synopsys IC Compiler II. ");
MGCAddSnippet(114, "API commands can be used to programmatically run Calibre nmDRC, as shown in the following sample script.");
MGCAddSnippet(115, "Calibre RealTime Digital provides commands to get and set environment variables from the command interface of supported design tools. Calibre RealTime Digital recompiles the rule file if an environment variable changes due to one of these commands. ");
MGCAddSnippet(116, "Gets the value of an environment variable. ");
MGCAddSnippet(117, "Determines if an environment variable exists in the Calibre RealTime Digital process.");
MGCAddSnippet(118, "Sets an environment variable in Calibre RealTime Digital and the design tool environment.");
MGCAddSnippet(119, "Unsets an environment variable in Calibre RealTime Digital and the design tool environment.");
MGCAddSnippet(120, "You can set the options in the Calibre RealTime Options dialog box using commands issued in supported design tools. This capability enables you to configure Calibre RealTime within the design environment. ");
MGCAddSnippet(121, "Add a run configuration with a specified name. ");
MGCAddSnippet(122, "Saves the current layer visibility to be restored later. This procedure is useful when using a CTO file with the RVE Show Layers rule check comment, which can alter layer visibility.");
MGCAddSnippet(123, "Delete the run configuration with the specified name. ");
