MGCAddSnippet(129, "Gets the configuration name of the current run configuration. ");
MGCAddSnippet(130, "Prints the available API commands with a summary description. ");
MGCAddSnippet(131, "Restores the saved layer visibility. If there is none saved, then the version before the first DRC run is used. This procedure is useful when using a CTO file with the RVE Show Layers rule check comment, which can alter layer visibility.");
MGCAddSnippet(132, "Saves the current Calibre RealTime Digital configuration. ");
MGCAddSnippet(133, "Sets the value of a Calibre RealTime Digital option that is independent of the run configuration. ");
